import{_ as e,d as r}from"./app.1d2f7275.js";const o={},i=r('<h1 id="\u6D4F\u89C8\u5668\u4E8C\u6218-1998-2007" tabindex="-1"><a class="header-anchor" href="#\u6D4F\u89C8\u5668\u4E8C\u6218-1998-2007" aria-hidden="true">#</a> \u6D4F\u89C8\u5668\u4E8C\u6218\uFF081998 - 2007\uFF09</h1><p>1998\u5E74\uFF0CNetscape\u4EE5\u5F00\u653E\u6E90\u4EE3\u7801\u7684\u6388\u6743\u5F62\u5F0F\uFF0C\u628ACommunicator\u6E90\u4EE3\u7801\u53D1\u5E03\uFF0C\u8BE5\u65B0\u4EA7\u54C1\u4ECD\u7136\u4F7F\u7528Mozilla\u7684\u540D\u79F0\uFF0C\u900F\u8FC7\u628A\u7A0B\u5E8F\u5F7B\u5E95\u91CD\u65B0\u7F16\u5199\uFF0CMozilla\u5DF2\u5728\u591A\u65B9\u9762\u5F97\u5230\u6539\u8FDB\u30022002\u5E74\uFF0CMozilla\u63A8\u51FA1.0\u7248\uFF0C\u5E76\u8FC5\u5373\u5728\u5F00\u6E90\u793E\u7FA4\u4E2D\u5F97\u4EE5\u666E\u53CA\u3002\u540C\u65F6\u53C8\u51FA\u73B0\u591A\u6B3E\u6D3E\u751F\u4EA7\u54C1\uFF0C\u5305\u62EC\u8F7B\u91CF\u8DE8\u5E73\u53F0\u6D4F\u89C8\u5668\uFF0C\u540D\u4E3AFirefox\uFF0C\u5B83\u4E8E2004\u5E74\u63A8\u51FA1.0\u7248\u3002\u8FD9\u4E9B\u4EE5Mozilla\u4E3A\u57FA\u7840\u7684\u4EA7\u54C1\u4E5F\u6162\u6162\u5728\u6D4F\u89C8\u5668\u5E02\u573A\u4E2D\u53D1\u5C55\u8D77\u6765\u3002</p><p>2000\u5E74\u52302003\u5E74\uFF0CIE\u7684\u5E02\u573A\u4EFD\u989D\u8D85\u8FC7\u4E86\u767E\u5206\u4E4B\u516B\u5341\uFF0C\u4E00\u5BB6\u72EC\u5927\uFF0C\u5904\u4E8E\u5784\u65AD\u5730\u4F4D\u7684IE\uFF0C\u6ECB\u751F\u4E86\u61D2\u60F0\u50B2\u6162\u8FD9\u79CD\u60C5\u7EEA\uFF0CIE5\u4E4B\u524D\uFF0CIE\u6BCF\u5E74\u8FDB\u884C\u4E00\u6B21\u5927\u7248\u672C\u66F4\u65B0\uFF0C\u800CIE5\u5230IE6\u7528\u4E86\u4E24\u5E74\u7684\u65F6\u95F4\uFF0C\u66F4\u725B\u63B0\u7684\u662F\uFF0C\u4ECEIE6\u5230IE7\u5C45\u7136\u8FC7\u4E865\u5E74\u7684\u65F6\u95F4\u3002</p><p>2003\u5E74\uFF0C\u5FAE\u8F6F\u5BA3\u5E03Internet Explorer 6 SP1\u7248\u672C\u5C06\u662F\u6700\u540E\u4E00\u6B3E\u4F9B\u72EC\u7ACB\u4E0B\u8F7D\u7684IE\u6D4F\u89C8\u5668\uFF0C\u800C\u4EA7\u54C1\u672A\u6765\u7684\u529F\u80FD\u52A0\u5F3A\u65B9\u9762\u5C06\u4EF0\u8D56\u4E8EWindows Vista\uFF0C\u5B83\u5305\u62ECWPF\u3001XAML\u7B49\u5DE5\u5177\uFF0C\u4EE5\u4F9B\u5F00\u53D1\u8005\u53BB\u521B\u5EFA\u6269\u5C55\u7F51\u7EDC\u5E94\u7528\u7A0B\u5E8F\u3002</p><p>\u5C31\u4E0A\u8FF0\u7684\u4E00\u70B9\uFF0CMozilla\u57FA\u91D1\u4F1A\u4E0EOpera\u8F6F\u4EF6\u516C\u53F8\u4E8E2004\u5E744\u6708\u5F00\u59CB\uFF0C\u5171\u540C\u5408\u4F5C\u5F00\u53D1\u65B0\u7684\u5F00\u653E\u6807\u51C6\uFF0C\u80FD\u5728\u4E0E\u73B0\u6709\u6280\u672F\u9006\u5411\u517C\u5BB9\u7684\u540C\u65F6\uFF0C\u4E5F\u53EF\u4EE5\u589E\u52A0\u66F4\u591A\u65B0\u529F\u80FD\u3002\u8FD9\u9879\u5DE5\u4F5C\u7531WHATWG\u5DE5\u4F5C\u5C0F\u7EC4\u8D1F\u8D23\uFF0C\u8BE5\u5C0F\u7EC4\u4E13\u95E8\u5FEB\u901F\u5236\u5B9A\u65B0\u6807\u51C6\u53CA\u5B9A\u4E49\uFF0C\u5E76\u4F1A\u63D0\u4EA4\u4E88W3C\u5BA1\u6279\u3002</p><p>2004\u5E746\u6708\uFF0C\u591A\u4E2AIE\u6D4F\u89C8\u5668\u53D7\u5230\u4E00\u4E2A\u540D\u4E3ADownload.ject\u7684\u6076\u610F\u7A0B\u5E8F\u653B\u51FB\uFF0C\u8FD9\u4F7F\u4EBA\u4EEC\u66F4\u6CE8\u610F\u5230IE\u672C\u8EAB\u7684\u5B89\u5168\u6027\u95EE\u9898\uFF0CIE\u7528\u6237\u53EA\u6D4F\u89C8\u4E00\u4E2A\u7F51\u9875\uFF0C\u4FBF\u6709\u673A\u4F1A\u53D7\u5230\u540E\u95E8\u3001\u6309\u952E\u8BB0\u5F55\u7B49\u6076\u610F\u7A0B\u5E8F\u5165\u4FB5\uFF0C\u800C\u7F8E\u56FD\u7535\u8111\u5B89\u5168\u4E8B\u6545\u534F\u8C03\u4E2D\u5FC3\u53CA\u591A\u95F4\u7535\u8111\u5B89\u5168\u516C\u53F8\u4E5F\u5EFA\u8BAE\u7528\u6237\u6539\u7528\u66F4\u5B89\u5168\u7684Firefox\uFF0C\u4EE5\u907F\u5F00\u6B64\u7B49\u653B\u51FB\u3002</p><p>2005\u5E742\u6708\uFF0C\u5FAE\u8F6F\u5BA3\u5E03Internet Explorer 7\u5C06\u5728Windows XP SP2\u53CA\u66F4\u9AD8\u7684Windows\u7248\u672C\u4E2D\u63D0\u4F9B\u3002\u9274\u4E8E\u5FAE\u8F6F\u4EA7\u54C1\u5B89\u5168\u6027\u6210\u4E3A\u4EBA\u4EEC\u7684\u70ED\u95E8\u8BDD\u9898\uFF0C\u5FAE\u8F6F\u63D0\u53CA\u65B0\u7248\u6D4F\u89C8\u5668\u7684\u5B89\u5168\u6027\u5C06\u6BD4Internet Explorer 6 SP2\u5927\u5927\u589E\u5F3A\u3002\u7531\u4E8E\u5FAE\u8F6F\u672A\u5C31\u7F51\u9875\u6807\u51C6\u65B9\u9762\u8868\u6001\uFF0C\u56E0\u6B64\u5F15\u8D77\u7F51\u9875\u5F00\u53D1\u8005\u53CA\u6807\u51C6\u652F\u6301\u8005\u7684\u5173\u6CE8\u3002\u6709\u4EBA\u8BA4\u4E3A\uFF0C\u5FAE\u8F6F\u4E3AWindows XP\u7528\u6237\u63D0\u4F9B\u65B0\u7248\u672CIE\u7684\u5347\u7EA7\uFF0C\u662F\u8FCE\u51FBFirefox\u666E\u53CA\u5316\u7684\u4E00\u6B65\u3002</p><p>\u81F32005\u5E74\u6700\u540E\u4E00\u5B63\uFF0CIE\u7684\u5E02\u573A\u5360\u6709\u7387\u8DCC\u81F385%\u5DE6\u53F3\uFF0C\u4E3B\u8981\u662F\u53D7\u5230Firefox\u7684\u7ADE\u4E89\uFF0C\u800C\u8815\u866B\u75C5\u6BD2\u3001\u95F4\u8C0D\u8F6F\u4EF6\u7B49\u900F\u8FC7IE\u4EA7\u54C1\u6F0F\u6D1E\uFF0C\u5E76\u5728\u7F51\u7EDC\u4F20\u64AD\uFF0C\u662F\u4F7FIE\u7528\u6237\u6539\u7528Firefox\u7684\u4E3B\u8981\u56E0\u7D20\u3002Linux\u4EA7\u54C1\u5F00\u59CB\u83B7\u5F97\u5E02\u573A\u91C7\u7EB3\uFF0C\u662F\u53E6\u5916\u4E00\u4E2A\u56E0\u7D20\uFF0C\u5B83\u4EEC\u5747\u9884\u88C5\u4E86Firefox\u6D4F\u89C8\u5668\u3002\u5176\u4ED6\u5BFC\u81F4IE\u4F7F\u7528\u7387\u4E0B\u964D\u7684\u539F\u56E0\u6709\uFF0CFirefox\u7684\u63A5\u53E3\u8BBE\u8BA1\u4E0EIE\u76F8\u4F3C\u3001\u652F\u6301\u6807\u7B7E\u9875\u6D4F\u89C8\u7B49\uFF0C\u4E0D\u5C11\u6539\u7528Firefox\u7684\u7528\u5BB6\uFF0C\u5747\u628AInternet Explorer\u4F5C\u4E3A\u5907\u7528\u6D4F\u89C8\u5668\uFF0C\u4EE5\u7528\u6765\u53EA\u6D4F\u89C8\u652F\u6301\u5FAE\u8F6F\u6D4F\u89C8\u5668\u6216\u4EC5\u4F9BInternet Explorer\u8FDB\u5165\u7684\u7F51\u9875\u3002\u4F46\u73B0\u5728\u6709\u4E00\u4E2A\u540D\u4E3AIE Tab\u7684\u6269\u5C55\uFF0C\u53EF\u4F9BFirefox\u4F7F\u7528IE\u7684Trident\u5F15\u64CE\uFF0C\u53BB\u6D4F\u89C8\u6B64\u7B49\u7F51\u9875\u3002</p><p>2006\u5E748\u6708\uFF0CFirefox\u3001Opera\u7B49\u6D4F\u89C8\u5668\u7684\u5E02\u573A\u5360\u6709\u7387\u6301\u7EED\u589E\u957F\uFF0C\u4F46\u589E\u901F\u653E\u7F13\u3002\u636E\u6700\u65B0\u7684\u8C03\u67E5\u663E\u793A\uFF0CFirefox\u5728\u5317\u7F8E\uFF0C\u6B27\u6D32\u7B49\u5730\u533A\u7684\u5360\u6709\u7387\u5DF2\u7ECF\u63A5\u8FD1\u6216\u8005\u8D85\u8FC720%\u3002\u8FD9\u4F7F\u5FAE\u8F6F\u611F\u53D7\u5230\u7684\u7ADE\u4E89\u538B\u529B\u500D\u589E\uFF0C\u4FC3\u4F7F\u5FAE\u8F6F\u52A0\u5FEBIE7\u7684\u5F00\u53D1\u6B65\u4F10\u3002</p><p>2006\u5E748\u6708\u5E95\uFF0C\u5FAE\u8F6F\u63A8\u51FAIE7\u7684\u7B2C\u4E00\u4E2A\u5019\u9009\u7248\u672C\uFF0C\u53EF\u4EE5\u8BF4IE7\u529F\u80FD\u7279\u6027\u65B9\u9762\u5DF2\u7ECF\u57FA\u672C\u5B9A\u578B\uFF08IE7\u63D0\u4F9B\u4E86\u6807\u7B7E\u9875\u5F0F\u6D4F\u89C8\uFF0CRSS\u9605\u8BFB\uFF0C\u589E\u5F3A\u7684\u63D2\u4EF6\u63A7\u5236\uFF0CCSS\u7B49\u7F51\u9875\u6807\u51C6\u7684\u589E\u5F3A\u652F\u6301\uFF0C\u4EE5\u53CA\u63D0\u4F9B\u7C7B\u4F3C\u4E8EFirefox\u6269\u5C55\u6A21\u5F0F\u7684\u9644\u52A0\u63D2\u4EF6\u4EE5\u589E\u52A0IE7\u7684\u9644\u52A0\u529F\u80FD\uFF0C\u5728\u5B89\u5168\u6027\u7B49\u65B9\u9762\u4EA6\u6709\u8F83\u5927\u6539\u8FDB\uFF09\u3002</p><p>\u53E6\u4E00\u65B9\u9762\uFF0CFirefox\u5728\u5360\u6709\u7387\u4E0A\u5347\u540E\u53D7\u5230\u6781\u5927\u7684\u5173\u6CE8\uFF0C\u4E0D\u65AD\u53D1\u73B0\u5B89\u5168\u6F0F\u6D1E\uFF0C\u7CFB\u7EDF\u8D44\u6E90\u5F00\u9500\u9887\u5927\u4E5F\u4F7F\u5F97\u67D0\u4E9B\u7528\u6237\u5BF9Firefox\u4EA7\u751F\u4E86\u4E00\u4E9B\u8D28\u7591\uFF0C\u4F46\u5176\u5148\u8FDB\u7684\u8BBE\u8BA1\u7406\u5FF5\u53CA\u4E30\u5BCC\u7684\u9644\u52A0\u529F\u80FD\u4F9D\u7136\u5438\u5F15\u4E86\u5927\u6279\u7684\u7528\u6237\u3002\u4EE5\u6D4F\u89C8\u901F\u5EA6\u5FEB\u6377\u8457\u79F0\u7684\u6D4F\u89C8\u5668Opera\u5728\u514D\u8D39\u63A8\u51FA\u540E\uFF0C\u4E5F\u8D62\u5F97\u4E86\u4E00\u4E9B\u7528\u6237\u7684\u9752\u7750\uFF0C\u5728\u4E2A\u4EBA\u7535\u8111\u4E0A\u7684\u5E02\u573A\u5360\u6709\u7387\u6709\u4E9B\u5FAE\u63D0\u5347\uFF0C\u800C\u5176\u5728\u884C\u52A8\u9886\u57DF\u4E0A\u4E5F\u5360\u6709\u5F88\u5927\u7684\u5E02\u573A\u5360\u6709\u7387\u3002</p><p>2006\u5E7410\u6708\u5E95\uFF0CInternet Explorer 7\u53CAMozilla Firefox 2\u76F8\u7EE7\u53D1\u884C\u3002IE7\u77ED\u77ED\u51E0\u5929\u5185\u4E0B\u8F7D\u91CF\u5373\u7A81\u7834\u4E09\u767E\u4E07\uFF0C\u7531\u6B64\u53EF\u89C1\u5E7F\u5927Windows\u7684\u7528\u6237\u5BF9IE7\u7684\u5173\u6CE8\u7A0B\u5EA6\u3002\u7136\u800C\uFF0CIE7\u6B63\u5F0F\u7248\u53D1\u884C\u51E0\u5C0F\u65F6\u540E\u5373\u53D1\u73B0\u5B89\u5168\u6F0F\u6D1E\uFF0C\u76F8\u5BF9\u5E02\u573A\u4E0A\u4F17\u591A\u6D4F\u89C8\u5668\uFF0C\u5E76\u4E0D\u65B0\u9896\u7684\u529F\u80FD\uFF0C\u90E8\u5206\u5265\u79BBWindows\u7CFB\u7EDF\u540E\u9020\u6210\u5176\u8D44\u6E90\u5360\u7528\u500D\u589E\uFF0C\u9700\u8981\u638F\u8170\u5305\u624D\u80FD\u4EAB\u53D7\u7684\u6269\u5C55\u670D\u52A1\uFF0C\u4E14\u4E0D\u652F\u6301\u8F83\u4F4E\u7248\u672C\u5982Windows 2000\u7CFB\u7EDF\uFF0C\u90FD\u8BA9\u4EBA\u5931\u671B\u3002\u5F53\u7136\uFF0CIE\u4EA6\u6709\u5176\u65E0\u53EF\u6BD4\u62DF\u7684\u4F18\u52BF\uFF0C\u8B6C\u5982\u64CD\u4F5C\u7CFB\u7EDF\u6346\u7ED1\uFF0C\u4F17\u591A\u529F\u80FD\u4E30\u5BCC\u7684\u7B2C\u4E09\u65B9\u6D4F\u89C8\u5668\u65E0\u6CD5\u63D0\u4F9B\u800C\u9020\u5C31\u7684IE\u7F51\u9875\u6807\u51C6\u5784\u65AD\uFF0C\u8FD9\u662F\u5176\u4ED6\u6D4F\u89C8\u5668\u65E0\u6CD5\u4F01\u53CA\u7684\u3002\u518D\u770BFirefox 2.0\uFF0C\u5BF9\u7F51\u9875\u6807\u51C6\u53CA\u65B0\u6280\u672F\u7684\u652F\u6301\uFF0C\u76F8\u5BF9\u5B89\u5168\u7684\u6D4F\u89C8\u4F53\u9A8C\uFF08\u867D\u7136\u6F0F\u6D1E\u4E0D\u65AD\uFF0C\u4F46\u81F3\u4ECA\u4E3A\u6B62\u5C1A\u65E0\u56E0\u653B\u51FBFirefox\u800C\u9020\u6210\u7528\u6237\u635F\u5931\u7684\u65B0\u95FB\uFF09\uFF0C\u8BA9\u5176\u5728\u6280\u672F\u4E0A\u9886\u5148IE\u6D4F\u89C8\u5668\uFF0C\u4F46\u76F8\u5BF9\u201C\u590D\u6742\u201D\u7684\u64CD\u4F5C\u53CA\u5BF9\u201CIE\u7F51\u9875\u6807\u51C6\u652F\u6301\u4E0D\u5B8C\u5584\u201D\u4F7F\u5927\u90E8\u5206\u666E\u901A\u7528\u6237\u671B\u4E4B\u602F\u6B65\uFF0C\u5176\u5E02\u573A\u5360\u6709\u7387\u4E00\u76F4\u7A33\u5B9A\u572816%\uFF0D18%\u4E4B\u95F4\u3002</p>',12);function E(I,p){return i}var t=e(o,[["render",E],["__file","browserWar2.html.vue"]]);export{t as default};
